import React from 'react';
import { connect } from 'react-redux';
import * as actions from '../../Redux/Actions/actions';

class Booking extends React.PureComponent {
  clickHandler = () => {
    this.props.getByEmail();
  };

  render() {
    var email;
    var firstName;
    var lastName;

    var validation = (
      <>
        <p>First name</p>
        <input
          type="text"
          onChange={(e) => {
            firstName = e.target.value;
          }}
        />
        <p>Last name</p>
        <input
          type="text"
          onChange={(e) => {
            lastName = e.target.value;
          }}
        />
        <p>Email</p>
        <input
          type="email"
          onChange={(e) => {
            email = e.target.value;
          }}
        />
        <button className="modalButton" onClick={this.clickHandler}>
          Next
        </button>
      </>
    );
    return <div>{validation}</div>;
  }
}

function mapStateToProps(state) {
  return {
    singleResponseData: state.singleResponseData,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getByEmail: (email) => dispatch(actions.FetchClientByEmail(email)),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(Booking);
